import React from "react";
import About from "../components/About";
import JobsCategory from "../components/JobsCategory";
function AboutPage() {
  return (
    <div>
      <section>
        <About />
      </section>
      <section className="inner-content">
        <JobsCategory />
      </section>
    </div>
  );
}

export default AboutPage;
